import { createBrowserRouter } from 'react-router-dom';
import RootLayout from './pages/RootLayout';
import HomePage from './pages/HomePage';
import Error from './pages/Error';
const router = createBrowserRouter([
  {
    path: '/',
    element: <RootLayout />,
    errorElement: <Error />,
    children: [
      {index: true, }
    ]
  }
])
function App() {
  return <div></div>;
}

export default App;
